is                                                      
  l_clob         varchar2(2000);
  l_buffer       varchar2(32767);
  l_amount       number;
  l_offset       number;
  l_body         varchar2(2000);
  l_param        varchar2(2000);
  l_token_type   varchar2(30);
  l_access_token varchar2(2000);
  l_url          varchar2(1000);
  l_https_host   varchar2(50);
  l_wallet_path  varchar2(50);

begin

  select TOKEN_TYPE,
         ACCESS_TOKEN,
         HTTPS_HOST,
         WALLET_PATH
  into l_token_type,
       l_access_token,
       l_https_host,
       l_wallet_path
  from XXPBSA_HO_OAUTH
  where 1 = 1
        AND SYSDATE between START_DATE and END_DATE;


      apex_web_service.g_request_headers(1).name    := 'Authorization';
      apex_web_service.g_request_headers(1).value   := l_token_type||' '||l_access_token;
      apex_web_service.g_request_headers(2).name    := 'Content-Type';
      apex_web_service.g_request_headers(2).value   := 'application/json';

       l_param := p_proc_name;

    begin
    IF l_param = 'purchase-orders'
        THEN
            
            l_body := XXPBSA_PO_PAYLOAD(p_po_num => p_param1);
           
    ELSIF l_param = 'suppliers'
        THEN
            BEGIN
              l_body := XXPBSA_CRUD_EBS_SUPPLIERS(p_param1, p_param2);
            END;
    ELSIF l_param = 'supplier-returns'
        THEN
            BEGIN
              l_body := XXPBSA_SUP_RET_PAYLOAD;
            END;
    ELSIF l_param = 'rejected-lines'
        THEN
            BEGIN
              l_body := XXPBSA_RET_LINES_PAYLOAD;
            END;            
    ELSE
            l_body := '{}';
    END IF;
    end;

  l_url := p_url;

  -- Invoke the PBSA web service to retrieve data

        select APEX_WEB_SERVICE.make_rest_request (    p_url         => l_url,
                                                       p_http_method => 'POST',
                                                       p_body        => l_body,
                                                       -- p_parm_name   => apex_util.string_to_table('appid:format'),
                                                       -- p_parm_value  => apex_util.string_to_table(apex_application.g_x01||':'||apex_application.g_x02)
                                                       p_wallet_path => l_wallet_path,
                                                       p_wallet_pwd  => null,
                                                       p_https_host  => l_https_host
                                                     )
        into l_clob
        from dual;


      return l_clob;

end;

