  CREATE OR REPLACE EDITIONABLE FUNCTION "APEX"."XXPBSA_PO_PAYLOAD" (p_po_num varchar2)
return varchar2
as

  l_msg    varchar2(20000);
  l_po_num varchar2(20);
  
BEGIN

    l_po_num := p_po_num;


