--                                   'SupplierId'        VALUE pl_outer.SupplierId,
--                                   'Lines'             VALUE ('['||
--                                                             json_object('PurchaseRequestLineId'    VALUE TO_NUMBER(pl_outer.PurchaseRequestLineId),
