--                   AND PRLA_outer.REQUISITION_HEADER_ID = PRHA_outer.REQUISITION_HEADER_ID
--                   AND pda_outer.po_line_id = pla_outer.po_line_id
--                   AND PDA_outer.REQ_DISTRIBUTION_ID = PRDA_outer.DISTRIBUTION_ID
--                   AND pha_outer.po_header_id = pla_outer.po_header_id
--                   AND pha_outer.SEGMENT1 = l_po_num
--                   AND pha_outer.authorization_status = 'APPROVED'
--                   AND pha_outer.attribute13 is null;

 SELECT 
 
 json_object('PurchaseOrderId'   VALUE h.SEGMENT1,
                   'SupplierId'        VALUE h.SupplierId,
                   'Lines'             VALUE (
                   '['||listagg(l.csv,', ') within group(order by l.csv) ||']'
                   )
                  FORMAT JSON)
 into l_msg
 from
 (select distinct TO_NUMBER(pha_outer.SEGMENT1) SEGMENT1,
         pl_outer.SupplierId
  from PURCHASE_REQUESTS_LINES pl_outer
                  ,PURCHASE_REQUESTS_HEADER ph_outer
                  ,PO_HEADERS_ALL@DATABASE_LINK_APEX_EBS pha_outer
                  ,PO_LINES_ALL@DATABASE_LINK_APEX_EBS pla_outer
                  ,PO_DISTRIBUTIONS_ALL@DATABASE_LINK_APEX_EBS PDA_outer
                  ,PO_REQ_DISTRIBUTIONS_ALL@DATABASE_LINK_APEX_EBS PRDA_outer
                  ,PO_REQUISITION_LINES_ALL@DATABASE_LINK_APEX_EBS PRLA_outer
                  ,PO_REQUISITION_HEADERS_ALL@DATABASE_LINK_APEX_EBS PRHA_outer
            WHERE  1 = 1
                   AND ph_outer.PurchaseRequestId = pl_outer.PurchaseRequestId
                   and NVL(PRHA_outer.INTERFACE_SOURCE_CODE, 0) = NVL(pl_outer.PurchaseOrderId, ph_outer.PurchaseRequestId)
                   AND PDA_outer.REQ_DISTRIBUTION_ID = PRDA_outer.DISTRIBUTION_ID
                   AND PRDA_outer.REQUISITION_LINE_ID = PRLA_outer.REQUISITION_LINE_ID
                   AND PRLA_outer.REQUISITION_HEADER_ID = PRHA_outer.REQUISITION_HEADER_ID
                   AND pda_outer.po_line_id = pla_outer.po_line_id
                   AND PDA_outer.REQ_DISTRIBUTION_ID = PRDA_outer.DISTRIBUTION_ID
                   AND pha_outer.po_header_id = pla_outer.po_header_id
                   AND pha_outer.SEGMENT1 = l_po_num
                   AND pha_outer.authorization_status = 'APPROVED'
                   AND pha_outer.attribute13 is null
 ) h,
 (
                                              select  distinct json_object('PurchaseRequestLineId' VALUE TO_NUMBER(pl_outer.PurchaseRequestLineId),
                                                                             'DateRequired'             VALUE PRLA_outer.NEED_BY_DATE,
                                                                             'ProductId'                VALUE pl_outer.ProductId,
                                                                             'Quantity'                 VALUE TO_NUMBER(pl_outer.Quantity),
                                                                             'Unit'                     VALUE pl_outer.Unit,
                                                                             'PerUnitCost'              VALUE TO_NUMBER(pl_outer.PerUnitCost),
                                                                             'PerUnitCostTax'           VALUE TO_NUMBER(pl_outer.PerUnitCostTax),
                                                                             'LineTotalCost'            VALUE TO_NUMBER(pl_outer.LineTotalCost),
                                                                             'LineTotalCostTax'         VALUE TO_NUMBER(pl_outer.LineTotalCostTax),
                                                                             'MrpIncTax'                VALUE TO_NUMBER(pl_outer.PERUNITPRICE)+TO_NUMBER(pl_outer.PERUNITPRICETAX),
                                                                             'TaxCode'                  VALUE 'GST',
                                                                             'Status'                   VALUE INITCAP(pha_outer.AUTHORIZATION_STATUS)
                                                         )  csv
        from PURCHASE_REQUESTS_LINES pl_outer
                  ,PURCHASE_REQUESTS_HEADER ph_outer
                  ,PO_HEADERS_ALL@DATABASE_LINK_APEX_EBS pha_outer
                  ,PO_LINES_ALL@DATABASE_LINK_APEX_EBS pla_outer
                  ,PO_DISTRIBUTIONS_ALL@DATABASE_LINK_APEX_EBS PDA_outer
                  ,PO_REQ_DISTRIBUTIONS_ALL@DATABASE_LINK_APEX_EBS PRDA_outer
                  ,PO_REQUISITION_LINES_ALL@DATABASE_LINK_APEX_EBS PRLA_outer
                  ,PO_REQUISITION_HEADERS_ALL@DATABASE_LINK_APEX_EBS PRHA_outer
            WHERE  1 = 1
                   AND ph_outer.PurchaseRequestId = pl_outer.PurchaseRequestId
                   and NVL(PRHA_outer.INTERFACE_SOURCE_CODE, 0) = NVL(pl_outer.PurchaseOrderId, ph_outer.PurchaseRequestId)
                   AND PDA_outer.REQ_DISTRIBUTION_ID = PRDA_outer.DISTRIBUTION_ID
                   AND PRDA_outer.REQUISITION_LINE_ID = PRLA_outer.REQUISITION_LINE_ID
                   AND PRLA_outer.REQUISITION_HEADER_ID = PRHA_outer.REQUISITION_HEADER_ID
                   AND pda_outer.po_line_id = pla_outer.po_line_id
                   AND PDA_outer.REQ_DISTRIBUTION_ID = PRDA_outer.DISTRIBUTION_ID
                   AND pha_outer.po_header_id = pla_outer.po_header_id
                   AND pha_outer.SEGMENT1 = l_po_num
                   AND pha_outer.authorization_status = 'APPROVED'
                   AND pha_outer.attribute13 is null
        )l
    where 1=1
    group by h.SEGMENT1, h.SupplierId;
    
  return l_msg;

END;

