--  DDL for Function XXPBSA_SUP_RET_PAYLOAD
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE FUNCTION "APEX"."XXPBSA_SUP_RET_PAYLOAD" 
return varchar2
as

  l_msg    varchar2(20000);

BEGIN
select 
json_object(
                'SupplierReturnId'     VALUE srh.SUPPLIERRETURNREQUESTID,
                'PurchaseRequestId'    VALUE PRHA.INTERFACE_SOURCE_CODE,
                'SupplierId'           VALUE srl.SupplierId,
                'Date'                 VALUE TO_CHAR(systimestamp, 'yyyy-mm-dd"T"HH24:MI:SS.SSTZH:TZM'),
                'Address'  VALUE (
                                 json_object('Street'       VALUE srh.Street,
                                             'City'         VALUE srh.City,
                                             'State'        VALUE srh.State,
                                             'PostCode'     VALUE srh.PostCode,
                                             'Country'      VALUE srh.Country,
                                             'ContactName'  VALUE srh.ContactName,
                                             'Phone'        VALUE srh.phone,
                                             'Email'        VALUE srh.email
                                             )
                                        ),
                'Lines'  VALUE ('['||
                     json_object('SupplierReturnRequestLineId'    VALUE TO_NUMBER(srl.SUPPLIERRETURNREQUESTLINEID),
                                 'ProductId'                      VALUE srl.ProductId,
                                 'Quantity'                       VALUE TO_NUMBER(srl.Quantity),
                                 'PerUnitCost'                    VALUE TO_NUMBER(PRLA.ATTRIBUTE9),
                                 'PerUnitCostTax'                 VALUE TO_NUMBER(PRLA.ATTRIBUTE8),
                                 'LineTotalCost'                  VALUE TO_NUMBER(PRLA.ATTRIBUTE7),
                                 'LineTotalCostTax'               VALUE TO_NUMBER(PRLA.ATTRIBUTE6),
                                 'MrpIncTax'                      VALUE TO_NUMBER(PRLA.ATTRIBUTE6)+TO_NUMBER(PRLA.ATTRIBUTE7),
                                 'Status'                         VALUE 'Approved'
                                 )||']'
                            )
                                  FORMAT JSON) J
      into l_msg
      FROM SUPPLIER_RET_REQUESTS_HEADER srh,
           SUPPLIER_RET_REQUESTS_LINES srl,
           po_lines_all@DATABASE_LINK_APEX_EBS pl,
           po_line_locations_all@DATABASE_LINK_APEX_EBS pll,
           po_distributions_all@DATABASE_LINK_APEX_EBS  pd,
           mtl_parameters@DATABASE_LINK_APEX_EBS        mp,
           mtl_system_items_b@DATABASE_LINK_APEX_EBS    msi,
           PO_REQ_DISTRIBUTIONS_ALL@DATABASE_LINK_APEX_EBS PRDA,
           PO_REQUISITION_LINES_ALL@DATABASE_LINK_APEX_EBS PRLA,
           PO_REQUISITION_HEADERS_ALL@DATABASE_LINK_APEX_EBS PRHA,
           ap_suppliers@DATABASE_LINK_APEX_EBS aps
     WHERE 1 = 1
           and srh.SupplierReturnRequestId = srl.SupplierReturnRequestId
           and srl.PRODUCTID = msi.attribute10(+)
           and srl.SUPPLIERID = aps.attribute10(+)
           and srh.STATUS_FLAG is NULL
           AND pl.po_line_id = pll.po_line_id
           AND pd.line_location_id = pll.line_location_id
           AND pd.po_line_id = pl.po_line_id
           AND pll.ship_to_organization_id = mp.organization_id
           AND msi.inventory_item_id = pl.item_id
           AND pd.REQ_DISTRIBUTION_ID = PRDA.DISTRIBUTION_ID
           AND PRDA.REQUISITION_LINE_ID = PRLA.REQUISITION_LINE_ID
           AND PRLA.REQUISITION_HEADER_ID = PRHA.REQUISITION_HEADER_ID
           AND rownum = 1;

  return l_msg;

END;

